ctive  -->\n\nPageHeaderModule->PageHeaderBottomDirective \n\n\n\n\n\nPageHeaderComponent \n\nPageHeaderComponent \n\nPageHeaderComponent  -->\n\nPageHeaderModule->PageHeaderComponent \n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            libs/ui-toolkit/page-header/src/lib/page-header.module.ts\n        \n\n\n\n\n        \n            \n                \n                    Declarations\n                    \n                        \n                            PageHeaderBottomDirective\n                        \n                        \n                            PageHeaderComponent\n                        \n                    \n                \n                \n                    Exports\n                    \n                        \n                            PageHeaderBottomDirective\n                        \n                        \n                            PageHeaderComponent\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import { ScrollingModule } from '@angular/cdk/scrolling';\nimport { CommonModule } from '@angular/common';\nimport { NgModule } from '@angular/core';\n\nimport { PageHeaderBottomDirective } from './page-header-bottom.directive';\nimport { PageHeaderComponent } from './page-header.component';\n\n@NgModule({\n  declarations: [PageHeaderComponent, PageHeaderBottomDirective],\n  exports: [PageHeaderComponent, PageHeaderBottomDirective],\n  imports: [CommonModule, ScrollingModule]\n})\nexport class PageHeaderModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/PastPeriodColonPipe.html":{"url":"pipes/PastPeriodColonPipe.html","title":"pipe - PastPeriodColonPipe","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Pipes\n  PastPeriodColonPipe\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n\n        \n            File\n        \n        \n            libs/ui-toolkit/pipes/src/lib/past-period-colon.pipe.ts\n        \n\n            \n                Description\n            \n            \n                PastPeriodColonPipe\nTransform the string containing current or lastXMonths into readable format (see examples)\nExamples:\n1) \"current\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\"  => current: 12/2019\n2) \"last6Months\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\" => last 6 months: 06/2019\n3) \"lastYear\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\" => last 12 months: 12/2018\n4) \"lastYear\" | pastPeriodColon: \"YYYY-MM-DD\": \"2019-12-24\" => last 12 months: 2018-12-24\n\n            \n\n\n        \n            Metadata\n            \n                \n                    \n                        Name\n                        pastPeriodColon\n                    \n                \n            \n        \n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        \n                            Public\n                            transform\n                        \n                        \n                    \n                \n            \n            \n                \n                    \n                    transform(value: string, format?: string, current?: string)\n                \n            \n\n\n            \n                \n                    Defined in libs/ui-toolkit/pipes/src/lib/past-period-colon.pipe.ts:23\n                \n            \n\n\n            \n                \n\n                    \n                        Parameters :\n                        \n                            \n                                \n                                    Name\n                                    Type\n                                    Optional\n                                \n                            \n                            \n                                \n                                    value\n                                    \n                                                string\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                \n                                \n                                    format\n                                    \n                                                string\n                                    \n\n                                    \n                                        Yes\n                                    \n\n\n                                \n                                \n                                    current\n                                    \n                                                string\n                                    \n\n                                    \n                                        Yes\n                                    \n\n\n                                \n                            \n                        \n                    \n                    \n                    \n                    \n                        Returns :         string\n\n                    \n                    \n                        \n                    \n                \n            \n        \n    \n\n\n    \n\n\n    \n        import { Pipe, PipeTransform } from '@angular/core';\nimport { TranslateService } from '@ngx-translate/core';\nimport { utc } from 'moment';\n\n/**\n * PastPeriodColonPipe\n *\n * Transform the string containing current or lastXMonths into readable format (see examples)\n *\n * Examples:\n * 1) \"current\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\"  => current: 12/2019\n * 2) \"last6Months\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\" => last 6 months: 06/2019\n * 3) \"lastYear\" | pastPeriodColon: \"MM/YYYY\": \"2019-12-24\" => last 12 months: 12/2018\n * 4) \"lastYear\" | pastPeriodColon: \"YYYY-MM-DD\": \"2019-12-24\" => last 12 months: 2018-12-24\n *\n */\n@Pipe({\n  name: 'pastPeriodColon'\n})\nexport class PastPeriodColonPipe implements PipeTransform {\n  constructor(private translate: TranslateService) {}\n\n  public transform(value: string, format?: string, current?: string): string {\n    let preColonStr = '';\n    let postColonStr = '';\n\n    if (!value.startsWith('last')) {\n      preColonStr = this.translate.instant(value);\n      postColonStr = utc(current).format(format);\n    } else {\n      const lastSplit = value.split('last');\n      const numMatches = lastSplit[1].match(/\\d+(?=\\w)/g) || [];\n\n      let n;\n      let period;\n      if (numMatches.length) {\n        n = +numMatches[0];\n        period = value.split(`${n}`)[1];\n      } else {\n        n = 1;\n        period = lastSplit[1];\n      }\n\n      period = period.toLowerCase();\n      if (period.startsWith('month')) {\n        postColonStr = utc(current).subtract(n, 'month').format(format);\n      } else if (period.startsWith('year')) {\n        postColonStr = utc(current).subtract(n, 'year').format(format);\n      }\n\n      if (period === 'year' && n === 1) {\n        preColonStr = this.translate.instant('last @n months', { n: 12 });\n      } else {\n        preColonStr = this.translate.instant(`last @n ${period}`, { n });\n      }\n    }\n\n    return `${preColonStr}: ${postColonStr}`;\n  }\n\n}\n\n    \n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/PipesModule.html":{"url":"modules/PipesModule.html","title":"module - PipesModule","bo